import React from "react";

const Province = ({ name, confirmed, recovered, deaths }) => {
  return (
    <div className="Province">
      <h1>{name}</h1>
      <p>{confirmed}</p>
      <p>{recovered}</p>
      <p>{deaths}</p>
    </div>
  );
};

export default Recipe;
